"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Empress Of India was situated at 285 Rotherhithe New Road. This pub closed in 1967 and has now been demolished. Also known as The Old Galley Wall.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nIt is now closed and in residential use. ** Weston Street is renamed from Baalzephon street sometime between 1869 and 1881, e.g. the address in 1856 is at 5 &amp; 6 Baalzephon street; The address is also given as 5 Baalzephon Street in 1869, and as 6 Baalzephon Street in 1839 and 1841\n</p>\n</div>\n</div>",
