"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThis street was renamed to Paris Garden.\n</p>\n<p>\nIt's beside an old pub, called the Rose and Crown.\n</p>\n</div>\n</div>",
