"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSchipka Pass ......... the Schipka Pass runs under the railways viaduct between Gallowgate and London Road. .........the name came from the notorious Schipka Pass, the site of many a massacre in the Russo-Turkish War of the 1870s.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nD block Jubilee Dwellings were on the corner of Gerridge Street (formerly Charles Street) and Weber Row.\n</p>\n<p>\nThis was just around the corner from <a href=\"place.html?pdx=4\">Barbel Street</a> and where <a href=\"person.html?idx=907\">Rose Fromm</a> lived in 1911.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLittle Sutton Street became Northburgh Street at some stage.\n</p>\n</div>\n</div>",
